import React, { Component } from "react";

class FindMe extends Component {
  render() {
    return (
      <div>
        <p className="comment">
          // find me
          -----------------------------------------------------------------------------------------
        </p>
        <p>> cd ~/Users/Aavo/Stuff</p>
        <p>> head -n 4 ./personal.txt</p>
        <p>> [Email]</p>
        <p>
          > <span className="redText"></span>
        </p>
        <p>> [LinkedIn]</p>
        <p>> [GitHub]</p>
        <p>> [Instagram]</p>
        <p>> </p>
      </div>
    );
  }
}

export default FindMe;
